import * as types from '../actions';

export default function(state = [], action) {

  const knifeReducer = action.knifeReducer;

  console.log(knifeReducer);
  switch(action.type) {
    case types.ADD_KNIFE:
      return { ...state, knifeReducer };
    default:
      return state;
  }
};
